import Layout from "../components/Layout/Layout";
import { Title } from "../components/Title/Title";

const About = () => (
  <Layout>
    <div>
      <Title> About BitzPrice </Title>
      <p>Application to view Bitcoin prices</p>
    </div>
  </Layout>
);

export default About;
